Mokok () is a rural locality (a selo) in Tsuntinsky District, Republic of Dagestan, Russia. Population:  There is 1 street in this selo.
Geography
Selo is located 153&nbsp;km from Makhachkala (capital of Dagestan) and 1,648&nbsp;km from Moscow. Derikh is the nearest rural locality.
